function showSidebar(){
	$(".sidebar").addClass("show");
	$(".side-overlay").addClass("show");
}

function hideSidebar(){
	$(".sidebar").removeClass("show");
	$(".side-overlay").removeClass("show");
}

$(document).ready(function() {
	$.fn.scrollbar && $('.pg_scrollable').scrollbar({
		ignoreOverlay: false
	});
	hljs.initHighlightingOnLoad();
});

$("blockquote").each(function(a,b){
	var type = ($(b).find("strong").hide().html()||"").toLowerCase().charAt(0);
	if(type === "n") $(b).addClass("alert").addClass("alert-info");
	else if(type === "w") $(b).addClass("alert").addClass("alert-warning");
	else if(type === "h") $(b).addClass("alert").addClass("alert-success");
	else if(type === "a") $(b).addClass("alert").addClass("alert-danger");
});

$("h2,h3,h4,h5").each(function(){
	var text = "# " + $(this).text();
	var link = location.href.split("#")[0] + "#" + $(this).attr("id");
	var tag = `<a href='${link}' title='${$(this).text()}'>${text}</a>`
	$(this).html(tag);
});

var list = [];
$("h2,h3,h4,h5").each(function(){
	list.push(this)
});
$("<div class='intro'><h6>Contents:</h6>"+list.map(function(a,b){
    return `
        <div>
			<a href="${$(a).find("a").attr("href")}">${"&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;".repeat(a.localName.substr(1)-2)+$(a).text().substr(2)}</a>
		</div>
	`
}).join("")+"</div>").insertAfter("h1");

if(document.getElementById(location.pathname)) document.getElementById(location.pathname).style["color"] = "rgb(227, 48, 81)";
if(document.getElementById(location.pathname+"chevron")) document.getElementById(location.pathname+"chevron").style["display"] = "inline-block";

$("table").addClass("table");

